import { GET } from "../types";

const initialState = { users: [], cities: [], projects: [] };

export default function data(state = initialState, action) {
  switch (action.type) {
    case GET:
      return {
        ...state,
        [action.page]: action.payload,
      };
    default:
      return state;
  }
}
